import React from 'react';
import logo from './logo.svg';
import './App.css';
import {
  BrowserRouter as router,
  Route,
  Link
} from 'react-router-dom'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />

      </header>
    </div>
  );
}

export default App;
